import React from 'react';
import { Accordion, Card } from 'react-bootstrap';

class Steps extends React.Component
{
    render() {
        return (
            <Accordion defaultActiveKey='1'>
                <Card>
                    <Accordion.Toggle as={Card.Header} eventKey='1'>Step 1</Accordion.Toggle>
                    <Accordion.Collapse eventKey='1'>Step 1 stuff here</Accordion.Collapse>
                </Card>
                <Card>
                    <Accordion.Toggle as={Card.Header} eventKey='2'>Step 2</Accordion.Toggle>
                    <Accordion.Collapse eventKey='2'>Step 2 stuff here</Accordion.Collapse>
                </Card>
            </Accordion>
        )
    }
}

export default Steps;
